package LeetCode;

import org.junit.Assert;
import org.junit.Test;
import 工具.ListNode;

/**
 * https://leetcode-cn.com/problems/valid-anagram/
 * 题目描述:
 * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的一个字母异位词。
 *
 * 解题思路
 * 用一个 int[] 数组存储每个字符的数量.
 * 如果是 unicode 编码, 则改成 Map 存储.
 */
public class _0242_有效的字母异位词 {

    @Test
    public void test1() {
        Assert.assertTrue(isAnagram("anagram", "nagaram"));
        Assert.assertFalse(isAnagram("rat", "car"));
    }

    @Test
    public void test2() {
        String str1 = "";
        String str2 = "";
        Assert.assertTrue(isAnagram(str1, str2));
    }

    public boolean isAnagram(String s, String t) {
        // 1. 统计 s 中的字符数量
        int[] dict = new int[26];
        for (int i = 0, len = s.length(); i < len; i++) {
            dict[s.charAt(i) - 'a']++;
        }
        // 2. 判断 t 中相同字符的数量
        for (int i = 0, len = t.length(); i < len; i++) {
            int idx = t.charAt(i) - 'a';
            dict[idx]--;
            if(dict[idx] < 0) {
                return false;
            }
        }
        // 3. s 和 t 的字符数量相减是否为0
        for (int i = 0, len = dict.length; i < len; i++) {
            if(dict[i] != 0) {
                return false;
            }
        }
        return true;
    }
}
